void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;
    // Time varying pixel colo
    vec3 col = 0.5 + 0.98*cos(-iTime+uv.yyx+vec3(15,2,69))*sin(iTime+uv.xyx+vec3(15,2,2)) - 0.56*cos(iTime+uv.yxy+vec3(33,3,5));

    // Output to screen
    fragColor = vec4(col,1.0);
}
